    private static List<String> getParenthesis(final int NUMBER) {
        final List<String> VALID_COMBINATIONS = new ArrayList<>();
        generateCombinations(
                VALID_COMBINATIONS,
                "",
                0,
                0,
                NUMBER
        );
        return VALID_COMBINATIONS;
    }

    private static void generateCombinations(
            final List<String> VALID_COMBINATIONS,
            final String CURRENT_COMBINATION,
            final int OPEN_COUNT,
            final int CLOSE_COUNT,
            final int MAX_PAIRS
    ) {
        if (CURRENT_COMBINATION.length() == MAX_PAIRS * 2)
            VALID_COMBINATIONS.add(CURRENT_COMBINATION);
        else {
            if (OPEN_COUNT < MAX_PAIRS)
                generateCombinations(
                        VALID_COMBINATIONS,
                        CURRENT_COMBINATION + "(",
                        OPEN_COUNT + 1,
                        CLOSE_COUNT,
                        MAX_PAIRS
                );
            if (CLOSE_COUNT < OPEN_COUNT)
                generateCombinations(
                        VALID_COMBINATIONS,
                        CURRENT_COMBINATION + ")",
                        OPEN_COUNT,
                        CLOSE_COUNT + 1,
                        MAX_PAIRS
                );
        }
    }
